
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './Dashboard.css';  // Import the CSS file for styling
// import SearchBar from './SearchBar';  // Import the SearchBar component
import PatientProfile from '../components/Patientprofile/PatientProfile'; // Import the PatientProfile component

const Dashboard = () => {
    const navigate = useNavigate();
    //   const [showSearch, setShowSearch] = useState(false);
    //   const [patient, setPatient] = useState(null);

    const handleCardClick = (type) => {
        if (type === 'model') {
            navigate('/search');
        } else if (type === 'add-patient') {
            navigate('/profileupdate');
        }
        else if (type === 'report') {
            navigate('/search');
        }
        else if (type === 'learn') {
            navigate('/learnmore');
        }
    };

    return (
        <div className="dashboard">
            <header className="dashboard-header">
                <div className="left">   <h1>Diabetic Retinopathy</h1>
                    <p>Diabetic retinopathy (DR) is an eye condition that can lead to vision loss or blindness in people with diabetes. It occurs when high blood sugar damages the
                        blood vessels in the retina, the light-sensitive tissue at the back of the eye. </p>
                    <button className="cta-button" onClick={() => handleCardClick('learn')}>Learn More</button>
                </div>
                <div className="right">
                    <img src="data:image/png;base64," alt="" />
                </div>

            </header>
            <div className="cards-container">
                <div className="card">
                    <img className="icon" src="https://cdn-icons-png.flaticon.com/512/9599/9599526.png" alt="" />
                    <h2>Add Patient</h2>
                    <p>Add a new patient by entering their details and uploading necessary documents for further processing</p>
                    <button className="cta-button" onClick={() => handleCardClick('add-patient')}>Add</button>
                </div>
                <div className="card">
                    <img className="icon" src="https://cdn-icons-png.flaticon.com/512/408/408443.png" alt="" />
                    <h2>Analyze Now</h2>
                    <p>Upload an image to analyze and detect signs of diabetic retinopathy using advanced image processing techniques.</p>
                    <button className="cta-button" onClick={() => handleCardClick('model')}>Analyze</button>
                </div>
                <div className="card">
                    <img className="icon" src="https://cdn-icons-png.flaticon.com/512/1317/1317755.png" alt="" />
                    <h2>View Reports</h2>
                    <p>View detailed reports of an already added patient, including diagnostic results and medical history.</p>
                    <button className="cta-button" onClick={() => handleCardClick('report')}>View</button>
                </div>
                <div className="card">
                    <img className="icon" src="https://cdn-icons-png.flaticon.com/512/5402/5402751.png" alt="" />
                    <h2>Learn More</h2>
                    <p>Learn more about diabetic retinopathy, its causes, symptoms, and treatment options to better understand this eye condition.</p>
                    <button className="cta-button" onClick={() => handleCardClick('learn')}>Learn</button>
                </div>
            </div>
        </div>
    );
};

export default Dashboard;
